import { createRoot } from 'react-dom/client';
import App from './App';
import React from 'react';
import './index.css';

function NavigationBar() {
    return (
        <h1>
            Hello from react!
        </h1>
    )
}

const domNode = document.getElementById('navigation');

const root = createRoot(domNode);
root.render(
    <React.StrictMode>
        <App />
        <NavigationBar />
    </React.StrictMode>
);
